import { useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faWhatsapp, faTelegram } from '@fortawesome/free-brands-svg-icons'
import { faCoffee,faFacebookF } from '@fortawesome/free-solid-svg-icons';

const Social = () => {
  return (
    <div className="social-buttons">
    <FontAwesomeIcon icon={faWhatsapp} className="social-buttons__button social-button social-button--whatsapp" />
    <FontAwesomeIcon icon={faFacebook} className="social-buttons__button social-button social-button--facebook" />
    <FontAwesomeIcon icon={faTelegram} className="social-buttons__button social-button social-button--telegram" />
    </div>
    )
}

export default Social
